</template>

<script>
  import js_of_model from './js_of_model'
    export default {
        name: "CatVsDog",
        components:{
          js_of_model
        },
        data(){
          return{
          cd_js:'<strong>阿猫阿狗识别</strong>是kaggle上的一个比赛，参赛者们需要不断调整模型与算法进行训练，以得到更高的准确率。猫狗识别也是一个很经典的案例，当我们学会使用简单的神经网络识别MNIST时，我们会想找一个值得练手的实验，而猫狗识别正是这样值得练手实验。',
          img_url:'data:image/jpeg;base64,',
          tips:true,
          hidden_:false,
          image_base64:'',
          upload_flag:{'pro':'上传图片中...0%'},
          upload_show:false,
          url:'/post_catdog',
          par:{'cat_par':0,'dog_par':20}
          }
        },
      methods:{
        uploadclick(){
          const upload = document.querySelector('#cd_upload').click()
        },

        show_img(event){
        let files=document.querySelector('#cd_upload').files[0]
        // this.imgDataUrl =this.getObjectURL(files)
        this.image_to_base64(files)
        this.hidden_=true
        // this.post_image()
        },

        getObjectURL(file){
          let url=null
          if (window.createObjectURL != undefined){
            url=window.createObjectURL(file)
          }
          else if(window.webkitURL!=undefined){
            url=window.webkitURL.createObjectURL(file)
          }
          else if(window.URL!=undefined){
            url=window.urlURL.createObjectURL(file)
          }
          return url
        },

        image_to_base64(file){
          var reader= new FileReader()
          reader.readAsDataURL(file)
          reader.onload=()=>{
            // console.log(reader.result)
            this.image_base64=reader.result
            // console.log(this.image_base64)
            this.post_image(reader.result)
          }
          reader.onerror=function (error) {
            console.log('error')
          }
        },

        post_image(){
        let  that=this
        this.upload_show=true
        let json_data={'base64':this.image_base64}
        this.$axios({method:'post',
        url: this.url,
        data:json_data,
        onUploadProgress:function (e) {
            var complete=(e.loaded/e.total*100|0)+'%'
            that.$set(that.upload_flag,'pro','上传图片中...'+complete)
            // this.upload_flag='上传图片中...'+complete
            // console.log('上传图片中...'+complete)
        },
        onDownloadProgress:function (e) {
            var complete = (e.loaded/e.total*100|0)+'%'
            that.$set(that.upload_flag,'pro','下载图片中...'+complete)
        }
        }).then(res=>{
          // console.log(res)
          // this.od_base64=res.data.base64_data
          this.upload_show=false
          this.$set(this.par,'cat_par',res.data.cat_par)
          this.$set(this.par,'dog_par',res.data.dog_par)
        })
      },


      }
    }
</script>

